import React, { useState, useEffect } from 'react';
import './css/expense-list.css'; // In ExpenseList.js
import Axios from 'axios'

function ExpenseList() {
    const [expenses, setExpenses] = useState([]);

    useEffect(() => {
        Axios.get("http://localhost:8080/api/expenses").then((response) => {
            console.log(response);
        });
    }, []);

    // useEffect(() => {
    //     // Replace with your logic to fetch expenses from server (e.g., API call)
    //     const fetchedExpenses = [
    //         { id: 1, description: 'Groceries', amount: 50 },
    //         { id: 2, description: 'Rent', amount: 1000 },
    //     ];
    //     setExpenses(fetchedExpenses);
    // }, []);

    return (
        <div className="expense-list">
            <h1>Expense List</h1>
            <table>
                <thead>
                    <tr>
                        <th>Description</th>
                        <th>Amount</th>
                    </tr>
                </thead>
                <tbody>
                    {expenses.map((expense) => (
                        <tr key={expense.id}>
                            <td>{expense.description}</td>
                            <td>{expense.amount}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
}

export default ExpenseList;
